void newBuffer(void){
    uint16_t phaseLocal[3] = {phaseGlobal[0], phaseGlobal[1], phaseGlobal[2]};
    uint16_t ampLocal[3] = {ampGlobal[0], ampGlobal[1], ampGlobal[2]};
    uint16_t sigLocal[3] = {sigGlobal[0], sigGlobal[1], sigGlobal[2]};
    int tempBuffer[BUFFER_SIZE];
    double sinPhase;
    int sqPhase;
    int triPhase;
    int sawPhase;
    for(int x = 0; x < 3; x++){
        for(int i = 0; i < BUFFER_SIZE; i++){
            switch(sigLocal[x]){
                case 0: //sin wave
                    sinPhase = ((i + phaseLocal[x]) & (BUFFER_SIZE - 1)) * 2 * PI / (BUFFER_SIZE - 1);
                    tempBuffer[i] += (int) (sin(sinPhase) *  65536) * ampGlobal[x];
                    break;
                case 1: //square wave
                    sqPhase = (i + phaseLocal[x]) & (BUFFER_SIZE - 1);
                    if(sqPhase >= 1023 && sqPhase <= 3072){
                        tempBuffer[i] += 65536 * ampGlobal[x];
                    }
                    else{
                        tempBuffer[i] += -65536 * ampGlobal[x];
                    }
                    break;
                case 2: //triangle wave
                    triPhase = (i + phaseLocal[x]) & (BUFFER_SIZE - 1);
                    if(triPhase < BUFFER_SIZE / 2){
                        tempBuffer[i] += (int) -(-(triPhase - 1023) * 64) * ampGlobal[x];
                    }
                    else{
                        tempBuffer[i] += (int) -(-(triPhase - 1023) * 64) * ampGlobal[x];
                    }
                    break;
                case 3: //saw wave
                    sawPhase = (i + phaseLocal[x]) & (BUFFER_SIZE - 1);
                    tempBuffer[i] += (int) ((sawPhase - 2046) * 32) * ampGlobal[x];
                    break;
            }
        }  
    }

    for(int i = 0; i < BUFFER_SIZE; i++){
        combinedBuffer[i] = tempBuffer[i];
    }
    
}


