void ampChange(int index, int amount){
    ampGlobalInt[index] += amount;
    ampGlobal[index] = ((float) ampGlobalInt[index]) / 4095;
    if(ampGlobalInt[index] > 4095){
        ampGlobalInt[index] = 4095;
    }
    if(ampGlobalInt[index] < 0){
        ampGlobalInt[index] = 0;
    }
}

void phaseChange(int index, int amount){
    phaseGlobal[index] += amount;
    if(phaseGlobal[index] > 4095){
        phaseGlobal[index] = 4095;
    }
    if(phaseGlobal[index] < 0){
        phaseGlobal[index] = 0;
    }
}

void volChange(float amount){
    if (volume <= 0.1 && amount < 0){
        volume = 0;
        
    }
    if (volume >= 7.9 && amount > 0){
        volume = 8;

    }
    else{
        volume += amount;
        printf("%0.1f",volume);
    }
}

