double getFrequency(void){
    static int targetFrequency = 0b0000;
    //printf("Made it here\n");
    int inLoop = 1;
    while(inLoop){

        char s = getchar();
        switch (s)
        {
        case 'q':
            sigGlobal[0] = (sigGlobal[0] - 1) & 0b11;
            break;
        case 'w':
            sigGlobal[0] = (sigGlobal[0] + 1) & 0b11;
            break;
        case 'e':
            sigGlobal[1] = (sigGlobal[1] - 1) & 0b11;
            break;
        case 'r':
            sigGlobal[1] = (sigGlobal[1] + 1) & 0b11;
            break;
        case 't':
            sigGlobal[2] = (sigGlobal[2] - 1) & 0b11;
            break;
        case 'y':
            sigGlobal[2] = (sigGlobal[2] + 1) & 0b11;
            break;
        case 'c':
            externCombine = 1;
            break;
        //notes
        case '1':
            phaseChange(0,-300);
            break;
        case '2':
            phaseChange(0,300);
            break;
        case '3':
            ampChange(0,-300);
            break;
        case '4':
            ampChange(0,300);
            break;

        case '5':
            phaseChange(1,-300);
            break;
        case '6':
            phaseChange(1,300);
            break;
        case '7':
            ampChange(1,-300);
            break;
        case '8':
            ampChange(1,300);
            break;

        case 'v':
            phaseChange(2,-300);
            break;
        case 'b':
            phaseChange(2,300);
            break;
        case 'n':
            ampChange(2,-300);
            break;
        case 'm':
            ampChange(2,300);
            break;
        case '+':
            volChange(0.1);
            break;
        case '-':
            volChange(-0.1);
            break;
        case 'a':
            if(getchar() == 'p'){
                targetFrequency |= NOTE_A;
            }
            else{
                targetFrequency &= ~NOTE_A;
            }
            break;
        case 's':
            if(getchar() == 'p'){
                targetFrequency |= NOTE_Bf;
            }
            else{
                targetFrequency &= ~NOTE_Bf;
            }
            break;
        case 'd':
            if(getchar() == 'f'){
                targetFrequency |= NOTE_B;
            }
            else{
                targetFrequency &= ~NOTE_B;
            }
            break;
        case 'f':
            if(getchar() == 'g'){
                targetFrequency |= NOTE_C;
            }
            else{
                targetFrequency &= ~NOTE_C;
            }
            break;
        case 'g':
            if(getchar() == 'p'){
                targetFrequency |= NOTE_Df;
            }
            else{
                targetFrequency &= ~NOTE_Df;
            }
            break;
        case 'h':
            if(getchar() == 'p'){
                targetFrequency |= NOTE_D;
            }
            else{
                targetFrequency &= ~NOTE_D;
            }
            break;
        case 'j':
            if(getchar() == 'p'){
                targetFrequency |= NOTE_Ef;
            }
            else{
                targetFrequency &= ~NOTE_Ef;
            }
            break;
        case 'k':
            if(getchar() == 'p'){
                targetFrequency |= NOTE_E;
            }
            else{
                targetFrequency &= ~NOTE_E;
            }
            break;
        case 'l':
            if(getchar() == 'p'){
                targetFrequency |= NOTE_F;
            }
            else{
                targetFrequency &= ~NOTE_F;
            }
            break;
        case ';':
            if(getchar() == 'p'){
                targetFrequency |= NOTE_Gf;
            }
            else{
                targetFrequency &= ~NOTE_Gf;
            }
            break;
        default:
        
            inLoop = 0;
            break;
        }
        }
    return targetFrequency;
}

