void vTaskADCAccuire(void * pvParameters){
    
    adc1_config_width(ADC_WIDTH_BIT_12);
    //PHASE 1 
    adc1_config_channel_atten(ADC1_CHANNEL_0,ADC_ATTEN_DB_11);
    //AMP 1
    adc1_config_channel_atten(ADC1_CHANNEL_3,ADC_ATTEN_DB_11);
    //PHASE 2 
    adc1_config_channel_atten(ADC1_CHANNEL_6,ADC_ATTEN_DB_11);
    //AMP 2
    adc1_config_channel_atten(ADC1_CHANNEL_7,ADC_ATTEN_DB_11);
    //PHASE 3 
    adc1_config_channel_atten(ADC1_CHANNEL_4,ADC_ATTEN_DB_11);
    //AMP 3
    adc1_config_channel_atten(ADC1_CHANNEL_5,ADC_ATTEN_DB_11);

    //SIG 1
    adc2_config_channel_atten(ADC2_CHANNEL_8,ADC_ATTEN_DB_11);
    //Sig 2
    adc2_config_channel_atten(ADC2_CHANNEL_0,ADC_ATTEN_DB_11);
    //Sig 3
    adc2_config_channel_atten(ADC2_CHANNEL_6,ADC_ATTEN_DB_11);

    while(1){
        int localPhase[3] = {0,0,0};
        int localAmp[3] = {0,0,0};
        int localSig[3] = {0,0,0};
        static float lastMeasuredAmp[3] = {0,0,0};
        static int lastMeasuredPhase[3] = {0,0,0};
        for(int i = 0; i < 100; i++){
            localPhase[0] += adc1_get_raw(ADC1_CHANNEL_0);
            localPhase[1] += adc1_get_raw(ADC1_CHANNEL_6);
            localPhase[2] += adc1_get_raw(ADC1_CHANNEL_4);
            localAmp[0] += adc1_get_raw(ADC1_CHANNEL_3);
            localAmp[1] += adc1_get_raw(ADC1_CHANNEL_7);
            localAmp[2] += adc1_get_raw(ADC1_CHANNEL_5);
        }
        adc2_get_raw(ADC2_CHANNEL_8,ADC_WIDTH_12Bit,&localSig[0]);
        adc2_get_raw(ADC2_CHANNEL_0,ADC_WIDTH_12Bit,&localSig[1]);
        adc2_get_raw(ADC2_CHANNEL_6,ADC_WIDTH_12Bit,&localSig[2]);
        //printf("%d %d %d \n",localSig[0], localSig[1], localSig[2]);

        for(int i = 0; i < 3; i++){
            localPhase[i] = localPhase[i] / 100;
            if(lastMeasuredPhase[i] - localPhase[i] > 25 || localPhase[i] - lastMeasuredPhase[i] > 25 || (localPhase[i] == 4095 && phaseGlobal[i] != 4095)){
                phaseGlobal[i] = localPhase[i];
                lastMeasuredPhase[i] = localPhase[i];
                //printf("P%d%d   \n",i,phaseGlobal[i]);
            }
            if (phaseGlobal[i] != phaseOld[i]){
                phaseOld[i] = phaseGlobal[i];
                printf("P%d%d   \n",i,phaseGlobal[i]);
            }

            
            localAmp[i] = localAmp[i] / 100;
            if(((float)localAmp[i]) / 4095 - lastMeasuredAmp[i] > 0.05 || lastMeasuredAmp[i] -((float)localAmp[i]) / 4095 > 0.05 || (localAmp[i] == 4095 && ampGlobalInt[i] != 4095)){
                ampGlobal[i] = ((float) localAmp[i]) / 4095;
                lastMeasuredAmp[i] = ampGlobal[i];
                ampGlobalInt[i] = localAmp[i];
                
                //printf("A%d%d   \n",i,localAmp[i]);
            }
            if (ampGlobalInt[i] != ampOld[i]){
                ampOld[i] = ampGlobalInt[i];
                printf("A%d%d   \n",i,ampGlobalInt[i]);
            }

            if(localSig[i] > 500 && localSig[i] < 1000){
                //sigGlobal[i] = 0;
            }
            if(localSig[i] > 1500 && localSig[i] < 2100){
                //sigGlobal[i] = 1;
            }
            if(localSig[i] > 2300 && localSig[i] < 3500){
                //sigGlobal[i] = 2;
            }
            if(localSig[i] > 3600){
                //sigGlobal[i] = 3;
            }
            if(sigGlobal[i] != sigOld[i]){
                printf("S%d%d\n",i,sigGlobal[i]);
                sigOld[i] = sigGlobal[i];
            }
        }
        vTaskDelay(10);
        //printf("TASK DONE\n");
    }
}

